INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(1, 'shoes', '1000', 'Shoes are one of the most comfortable footwear options you can wear on a daily basis. They are versatile, flexible, and can suit various outfit styles well. A large number of styles of this footwear option hosted online for men, women, and kids can make shopping for suitable footwear easy. You can find styles like sneakers, loafers, lace-ups, and boots that you can style on different occasions. Sneakers and boots can be some of the best options for pairing with your casual wear, while loafers and boots can add a hint of sophistication to your semi-formal looks. There are also styles available online that are specifically designed for wearing to the gym, sports training, trekking, walking, and running.', , ''),
(2, 'Mobile', '16000', '48MP+5MP+2MP+2MP Quad camera setup- True 48MP (F 2.0) main camera + 5MP (F2.2) Ultra wide camera+ 2MP (F2.4) depth camera + 2MP (2.4) Macro Camera| 8MP (F2.2) front came\r\n6000mAH lithium-ion battery, 1 year manufacturer warranty for device and 6 months manufacturer warranty for in-box accessories including batteries from the date of purchase\r\nAndroid 11, v11.0 operating system,One UI 3.1, with 8nm Power Efficient Exynos850 (Octa Core 2.0GH\r\n16.55 centimeters (6.5-inch) HD+ TFT LCD - infinity v-cut display,90Hz screen refresh rate, HD+ resolution with 720 x 1600 pixels resolution, 269 PPI with 16M color', , '');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(3, 'Watch', '2000', 'Alexa built-in Voice Assistant that sets reminders, alarms and answers questions from weather forecasts to live cricket scores at your command!\r\n1.69\" big square colour LCD display with a round dial features complete capacitive touch experience to let you take control, effortlessly.\r\nMultiple watch faces with customizable options to match your OOTD, every day!\r\nThe ambient light display allows automatic adjustment of brightness on the watch, suited to your environment.\r\nThe watch comes with a stress monitor that reads your HRV (Heart Rate Variabilities) to indicate stress levels.', , '');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(4, 'Cloth', '1500', 'BRAND: COTTONWORLD\r\nCATEGORY: WOMEN\r\nOCCASION: CASUAL WEAR\r\nTYPE: KTIGHTS\r\nPRINT: SOLID\r\nFABRIC: COTTON\r\nFABRIC COMPOSITION: 95% COTTON 5% ELASTANE KNIT SOLID CO-SP\r\nFIT TYPE: REGULAR FIT\r\nCOLOR: CHARCOAL\r\nPOCKET: SELECT\r\nLENGTH: FULL LENGTH\r\nWAIST: SELECT\r\nOPENING: SELECT\r\nLEG: SELECT\r\nHEMLINE BOTTOM: SELECT', , '');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(5, '108 Panchatantra Stories', '100', 'Depicting the ?five principle conduct? about life, The Panchatantra Stories are timeless classics. Readers of all age groups enjoy reading and re-reading the Panchatantra Stories as they impart profound wisdom and moral values about the conduct of life through simple narratives. Written in their present form by Pandit Vishnu Sharma, the Panchatantra Stories were narrated to impart worldly wisdom to king Amar shakti three sons. With these enchanting stories, readers especially kids will love to explore the adventurous worlds of their favourite animal characters and learn life lessons about friendship, courage, honesty, good, evil, deceit, hard work and integrity.', , '');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(6, 'Walking Shoes', '750', 'Featuring perforation on the upper for breathability, these white sports shoes for men from Red Tape will take your style to a new high. Featuring a lace closure for a snug fit, these shoes are detailed with textile upper ensuring wearing comfort, while the EVA (ethylene-vinyl acetate) sole promises better flexibility on different kinds of surfaces. When going for running, you can pair these shoes with track pants and T-shirt.', , 'Shos');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(11, 'Red Tape mens Rff076 Sliders', '570', ' Used the slippers for a day. Looked and felt very comfortable and soft, but by the end of the day the straps started tearing and within no time it has become unusable. Built quality is very fragile. Do not buy..', , 'Shos');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(13, 'Red Tape', '1500', 'The inside of the shoe is very soft and comfortable to wear.\r\nI have a size 10 foot and bought size 10 red tape shoe, but the shoe holds foot tightly and uncomfortable for long time wearing. So do a size check before buying. otherwise for the price, the shoe is very good', , 'Shos'),
(14, 'Red Tape', '1090', 'Designed for fitness enthusiasts, the shoe is constructed with a mesh body on the upper front allowing ventilation and breathability during workouts and while running. A cushioned midsole, easy on and off, durable fabric and a textured black and grey shell is surely a great fit for physical activities and casually strolling down the streets.Product color may slightly vary due to photographic lighting sources or your monitor settings.', , 'Shos'),
(15, 'Formal Shoes', '1090', 'The Black Red Tape Derbies are the perfect pair for formal occasions. Its intricate cutout on the upper leather of the shoes make them visually appealing and unique. Pair them with charcoal trousers and a white shirt to make heads turn.', , 'Shos');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(16, 'Sneaker', '1150', 'Uplift your Casual look with this pair of white Sneakes from the house of Red Tape. It features synthetic PU upper that ensures comfort and enhances overall look along with super comfy rubber sole that ensures treaction on any surface. A supreme choice for any casual lookProduct color may slightly vary due to photographic lighting sources or your monitor settings.', , 'Shos'),
(17, 'Walking Shoe', '1850', 'An innovative creation from Red Tape is these sports shoes for men. Made using EVA flow sole and woven PU upper you will enjoy ultimate comfort, flexibility and surface grip. Being lightweight and breathable you will experience a surge in energy levels. Keep your feet fresh and dry while you sweat it out.', , 'Shos');
INSERT INTO `shop` (`user_id`, `product_name`, `product_price`, `Desc`, `image`, `category`) VALUES
(18, 'Sandal', '1850', 'Criss-cross strap design black sandals by Red Tape make the go-to summer footwear for men looking for comfort. The buckle closure ensures a perfect fit along with adding a visual appeal. The comfort coming from the synthetic PU upper and the sturdy PU sole enhances the overall walking experience. Team these convenient sandals with casuals for a smart look', , 'Shos'),
(20, 'Bond Street', '1900', 'With the logo on the side, the pair of grey sports shoes from Bond street by Red Tape derives a signature look. They come in an EVA sole make with knit mesh upper channeling airflow optimally. Enjoy a seamless performance with superior comfort of heels and flexibility in movement with these shoes.', , 'Shos');
